	public static boolean validateXMLSchema(String xsdStr, String xmlPath) {
		try {
			SchemaFactory factory = SchemaFactory.newInstance(XMLConstants.W3C_XML_SCHEMA_NS_URI);
			// File f=new File("newFile.xsd");
			// FileUtils.writeStringToFile(f, xsdStr);
			Schema schema = factory.newSchema(new StreamSource(new StringReader(xsdStr)));
			Validator validator = schema.newValidator();
			validator.validate(new StreamSource(new StringReader(xmlPath)));
		} catch (IOException e) {
			System.out.println("Exception: " + e.getMessage());
			return false;
		} catch (SAXException e1) {
			System.out.println("SAX Exception: " + e1.getMessage());
			e1.printStackTrace();
			return false;
		}

		return true;

	}

	public static boolean validateInputStreamFromXSD(String xsdStr, byte[] xmlBytes) {
		try(ByteArrayInputStream xmlIs = new ByteArrayInputStream(xmlBytes)) {
			SchemaFactory factory = SchemaFactory.newInstance(XMLConstants.W3C_XML_SCHEMA_NS_URI);
			Schema schema = factory.newSchema(new StreamSource(new StringReader(xsdStr)));
			Validator validator = schema.newValidator();
			validator.validate(new StreamSource(xmlIs));
		} catch (IOException e) {
			System.out.println("Exception: " + e.getMessage());
			return false;
		} catch (SAXException e1) {
			System.out.println("SAX Exception: " + e1.getMessage());
			e1.printStackTrace();
			return false;
		}

		return true;

	}
	
	
	
	public static List<Map<String, String>> getXmlDataUsingSTAX(InputStream xmlFile)
	{
		SAXParserFactory parserFactor = SAXParserFactory.newInstance();
		SAXParser parser;
		try 
		{
			parser = parserFactor.newSAXParser();
			
			SAXHandler handler = new SAXHandler();
			parser.parse(xmlFile, handler);

			// Printing the list of employees obtained from XML
			for (EmployeeRecord emp : handler.empList) {
				System.out.println("%%%"+emp);
			}
			
			
			
			
		} catch (ParserConfigurationException | SAXException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
		

		return null;
		
	}

	public static List<Map<String, String>> getXmlData(String xmlFile, int chunkSize) throws TransformerException {

		List<Map<String, String>> records = new ArrayList<Map<String, String>>();
		Map<String, String> employeeRecordMap = new HashMap<String, String>();

		DocumentBuilderFactory dbf = DocumentBuilderFactory.newInstance();
		DocumentBuilder db;
		try {
			db = dbf.newDocumentBuilder();

			@SuppressWarnings("deprecation")
			Document doc = db.parse(new StringBufferInputStream(xmlFile.toString()));
			// Document xmldoc =
			// PreIngestXmlUtil.convertStringToDocument(xmlFile.toString());

			NodeList nodeList = doc.getDocumentElement().getChildNodes();

			String key = "";
			String value = "";
			int employeeRecordCount = 0;
			Node employeeRecord = null;

			for (int temp = 0; temp < nodeList.getLength(); temp++) {

				Node nNode = nodeList.item(temp);

				// EmployeeRecordList
				if (nNode.getNodeType() == Node.ELEMENT_NODE
						&& nNode.getNodeName().equalsIgnoreCase("EmployeeRecordsList")) {
					NodeList employeeRecords = nNode.getChildNodes();

					if (employeeRecords != null && employeeRecords.getLength() > 0)
						for (int i = 0; i < employeeRecords.getLength(); i++) {

							employeeRecord = employeeRecords.item(i);

							if (employeeRecord.getNodeType() == Node.ELEMENT_NODE) {

								Element employeeRecordEle = (Element) employeeRecord;
								NodeList employeeRecordEleList = employeeRecordEle.getChildNodes();

								for (int j = 0; j < employeeRecordEleList.getLength(); j++) {
									Node node = employeeRecordEleList.item(j);
									if (node.getNodeType() == Node.ELEMENT_NODE) {
										Element nodeEle = (Element) node;
										if (!nodeEle.hasChildNodes()) {
											employeeRecordMap.put(node.getNodeName(), node.getTextContent().trim());
										} else {
											String str = nodeListToString(node.getChildNodes());
											System.out.println(PreIngestXmlUtil.convertXmltoJSON(str));
											if (node.getChildNodes().getLength() > 0)
												employeeRecordMap.put(node.getNodeName(), str);
										}
									}
								}
								employeeRecordCount++;
								// if(employeeRecordCount==chunkSize)
								// break;
							}
						}

					records.add(employeeRecordMap);
				}
			}

		} catch (ParserConfigurationException e) {
			System.out.println("ParserConfigurationException::" + e.getMessage());
		} catch (SAXException e) {
			System.out.println("SAXException::" + e.getMessage());
		} catch (IOException e) {
			System.out.println("IOException::" + e.getMessage());
		}

		return records;
	}

	private static String nodeListToString(NodeList nodes) throws TransformerException {
		DOMSource source = new DOMSource();
		StringWriter writer = new StringWriter();
		StreamResult result = new StreamResult(writer);
		Transformer transformer = TransformerFactory.newInstance().newTransformer();
		transformer.setOutputProperty(OutputKeys.OMIT_XML_DECLARATION, "yes");

		for (int i = 0; i < nodes.getLength(); ++i) {
			source.setNode(nodes.item(i));
			transformer.transform(source, result);
		}

		return writer.toString();
	}

	public static String formatXSD(String xsdString) {
		try {

			Source xmlInput = new StreamSource(new StringReader(xsdString));
			StringWriter stringWriter = new StringWriter();
			StreamResult xmlOutput = new StreamResult(stringWriter);
			TransformerFactory transformerFactory = TransformerFactory.newInstance();
			transformerFactory.setAttribute("indent-number", 2);
			Transformer transformer = transformerFactory.newTransformer();
			transformer.setOutputProperty(OutputKeys.INDENT, "yes");
			transformer.transform(xmlInput, xmlOutput);

			return xmlOutput.getWriter().toString();
		} catch (Exception e) {
			throw new RuntimeException(e);
		}
	}

